import React from 'react'; // Import React
import { Container, Jumbotron, Button } from 'react-bootstrap'; // Import Bootstrap components
import { Link } from 'react-router-dom'; // Import Link for navigation

const Home = () => {
  return (
    <Container className="mt-5">
      {/* Jumbotron for the hero section */}
      <Jumbotron>
        <h1>Welcome to Student Network</h1>
        <p>
          Connect with fellow students, share ideas, and grow together.
        </p>
        <p>
          {/* Button to navigate to the Profile page */}
          <Button as={Link} to="/profile" variant="primary">
            View Profile
          </Button>
        </p>
      </Jumbotron>
    </Container>
  );
};

export default Home; // Export the Home component
